import React,{useEffect,useState} from 'react';
import './App.css';

function App() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() =>{
    fetch('http://localhost:3000/api').then(
      response => response.json()
    ).then(
      data=>{
        setBackendData(data)
      }
    )
  },[]);
  return (
    <div className="App">

    </div>
  );
}

export default App;
